import React from "react";
import "./Aboutus.css";

const AboutUs = () => {
  return (
    <div className="AboutUs">
      <h1>ABOUT US</h1>
      <p>Welcome to our news website! We strive to provide you with accurate and timely information on current events.</p>
      <p>In today's digital age, misinformation can spread quickly. To combat this, we have implemented a Fake News Detection feature that helps identify unreliable sources and highlight verified news articles.</p>
      <p>Our team is dedicated to journalistic integrity and ethics and ensuring that you receive only the most credible news.</p>
      <p id="p4">Thank you for choosing us as your trusted news source!</p>
    </div>
  );
};

export default AboutUs;
